extras.old_content:
def _parse_values(query: str, var: str) -> List[str]:
    m = re.search(rf"VALUES \\?{re.escape(var)} \\{{([^}}]+)\\}}", query)
    if not m:
        return []
    return [t for t in m.group(1).split() if t]

extras.new_content:
def _parse_values(query: str, var: str) -> List[str]:
    # SPARQL syntax is e.g. "VALUES ?term { CL:0000084 CL:0000236 }"
    m = re.search(rf"VALUES \?{re.escape(var)} \{{([^}}]+)\}}", query)
    if not m:
        return []
    return [t for t in m.group(1).split() if t]
